expressions.body:
if self.requiredInterface.oclIsKindOf(SenderReceiverInterface)
					then self.requiredInterface.oclAsType(SenderReceiverInterface).dataElement.type
						->asOrderedSet()
					else if self.requiredInterface.oclIsKindOf(ClientServerInterface)
						then self.requiredInterface.oclAsType(ClientServerInterface).operation.argument.type
							->asOrderedSet()
						else OrderedSet(AutosarDataType){}
						endif
					endif

if getFilter().oclIsUndefined()
					then false
					else getFilter().isFilterEnabled()
					endif

if self.internalBehavior.oclIsUndefined()
					then Set{}
					else self.internalBehavior.getImplementationDataTypes(applicationDataType)
					endif

let internalUsingDataTypes : Set(AutosarDataType) = if self.internalBehavior.oclIsUndefined()
					then Set{}
					else self.internalBehavior.getUsingDataTypes()
					endif
				in getRPorts().getUsingDataTypes()
					->union(getPPorts().getUsingDataTypes())
					->union(internalUsingDataTypes)
					->asOrderedSet()

if self.internalBehavior.oclIsUndefined()
					then null
					else self.internalBehavior.getImplementationDataType(dataType)
					endif

if self.providedInterface.oclIsKindOf(SenderReceiverInterface)
					then self.providedInterface.oclAsType(SenderReceiverInterface).dataElement.type
						->asOrderedSet()
					else if self.providedInterface.oclIsKindOf(ClientServerInterface)
						then self.providedInterface.oclAsType(ClientServerInterface).operation.argument.type
							->asOrderedSet()
						else OrderedSet(AutosarDataType){}
						endif
					endif
